import React from 'react';
import MyButton from './MyButton';
import NavigationBar from './NavigationBar';

class App extends React.Component{
  render()
  {
    return (
      <div>
        <NavigationBar/>
        <MyButton/>
      </div>
    );
  }

}

export default App;
